import{_ as t,c as e,o as d,ab as o}from"./chunks/framework.CUflZczI.js";const p=JSON.parse('{"title":"PX4 SD Card Layout","description":"","frontmatter":{},"headers":[],"relativePath":"zh/concept/sd_card_layout.md","filePath":"zh/concept/sd_card_layout.md"}'),a={name:"zh/concept/sd_card_layout.md"},r=o('<h1 id="px4-sd-card-layout" tabindex="-1">PX4 SD Card Layout <a class="header-anchor" href="#px4-sd-card-layout" aria-label="Permalink to &quot;PX4 SD Card Layout&quot;">​</a></h1><p>The PX4 SD Card is used for storing configuration files, flight logs, mission information etc.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The SD card should be FAT32 formatted for use with PX4 (this is the default for SD cards). We recommend that you reformat cards that are using a different file system.</p></div><p>The directory structure/layout is shown below.</p><table><thead><tr><th>Directory/File(s)</th><th>描述</th></tr></thead><tbody><tr><td><code>/etc/</code></td><td>Extra config. See <a href="./../concept/system_startup.html#replacing-the-system-startup">System Startup &gt; Replacing the System Startup</a>.</td></tr><tr><td><code>/log/</code></td><td>Full <a href="./../dev_log/logging.html">flight logs</a></td></tr><tr><td><code>/mission_log/</code></td><td>Reduced flight logs</td></tr><tr><td><code>/fw/</code></td><td><a href="./../dronecan/">DroneCAN</a> firmware</td></tr><tr><td><code>/uavcan.db/</code></td><td>DroneCAN DNA server DB + logs</td></tr><tr><td><code>/params</code></td><td>Parameters (if not in FRAM/FLASH)</td></tr><tr><td><code>/dataman</code></td><td>Mission storage file</td></tr><tr><td><code>/fault_&lt;datetime&gt;.txt</code></td><td>Hardfault files</td></tr><tr><td><code>/bootlog.txt</code></td><td>Boot log file</td></tr></tbody></table>',5),c=[r];function s(i,l,n,h,_,u){return d(),e("div",null,c)}const m=t(a,[["render",s]]);export{p as __pageData,m as default};
